	if(!messages.containsKey(message)){
		messages.put(message,timestamp);
		return true;
	}
	else{
		int oldTime = messages.get(message);
		if(timestamp - oldTime >= 10){
			messages.put(message,timestamp);
			return true;
		}
		else{
			return false;
		}
	}
}

