	if(byteArrayValue==null){
		return this;
	}
	if(byteOffset<0||byteLength<0||byteOffset+byteLength>byteArrayValue.length){
		throw new IllegalArgumentException("Invalid byte array offset or length.");
	}
	if(byteLength==0){
		return this;
	}
	final int byteVectorLength=this.length;
	final int byteVectorCapacity=this.capacity;
	if(byteVectorLength+byteLength>byteVectorCapacity){
		this.capacity=byteVectorCapacity+Math.max(byteVectorCapacity,byteLength);
		final byte[] newByteArray=new byte[this.capacity];
		System.arraycopy(this.byteArray,0,newByteArray,0,byteVectorLength);
		this.byteArray=newByteArray;
	}
	System.arraycopy(byteArrayValue,byteOffset,this.byteArray,byteVectorLength,byteLength);
	this.length=byteVectorLength+byteLength;
	return this;
}

