public void readFrom(final InputStream in) throws IOException {

	int len = in.read();
	if (len == -1) {
		throw new IOException("Unexpected end of stream.");
	}
	if (len > 0) {
		byte[] buf = new byte[len];
		int read = 0;
		while (read < len) {
			int r = in.read(buf, read, len - read);
			if (r == -1) {
				throw new IOException("Unexpected end of stream.");
			}
			read += r;
		}
		this.buffer = buf;
	} else {
		this.buffer = null;
	}
}

