		return timeBucket;
	}

	Calendar calendar = Calendar.getInstance();
	calendar.setTimeInMillis(timeBucket);
	int day = calendar.get(Calendar.DAY_OF_MONTH);
	int dayOfMonth = calendar.getActualMaximum(Calendar.DAY_OF_MONTH);
	if(day <= dayStep){
